import{_ as e,o as t,c as a,Q as i}from"./chunks/framework.25ff06b1.js";const _=JSON.parse('{"title":"懂的都懂","description":"","frontmatter":{},"headers":[{"level":1,"title":"懂的都懂","slug":"懂的都懂","link":"#懂的都懂","children":[{"level":2,"title":"一、动态修改hosts文件","slug":"一、动态修改hosts文件","link":"#一、动态修改hosts文件","children":[]},{"level":2,"title":"二、Steam++","slug":"二、steam","link":"#二、steam","children":[]},{"level":2,"title":"三、fastgithub","slug":"三、fastgithub","link":"#三、fastgithub","children":[{"level":3,"title":"1. 解决 \\"XXX\\" cannot be opened because the developer cannot be verified","slug":"_1-解决-xxx-cannot-be-opened-because-the-developer-cannot-be-verified","link":"#_1-解决-xxx-cannot-be-opened-because-the-developer-cannot-be-verified","children":[]},{"level":3,"title":"2. 安装证书","slug":"_2-安装证书","link":"#_2-安装证书","children":[]},{"level":3,"title":"3.配置代理","slug":"_3-配置代理","link":"#_3-配置代理","children":[{"level":4,"title":"3.1 自动代理","slug":"_3-1-自动代理","link":"#_3-1-自动代理","children":[]},{"level":4,"title":"3.2 手动代理","slug":"_3-2-手动代理","link":"#_3-2-手动代理","children":[]}]}]}]}],"relativePath":"article/bigMan/工具网站/1.科学上网.md","filePath":"article/bigMan/工具网站/1.科学上网.md","lastUpdated":1707839101000}'),l={name:"article/bigMan/工具网站/1.科学上网.md"},o=i('<h1 id="懂的都懂" tabindex="-1">懂的都懂 <a class="header-anchor" href="#懂的都懂" aria-label="Permalink to &quot;懂的都懂&quot;">​</a></h1><h2 id="一、动态修改hosts文件" tabindex="-1">一、动态修改hosts文件 <a class="header-anchor" href="#一、动态修改hosts文件" aria-label="Permalink to &quot;一、动态修改hosts文件&quot;">​</a></h2><p>文件获取地址：<a href="https://raw.hellogithub.com/hosts" target="_blank" rel="noreferrer">https://raw.hellogithub.com/hosts</a></p><p>可以手动进行修改，不过比较麻烦，可以使用一款软件<code>SwitchHosts</code>，可以定期动态修改hosts文件，</p><p>软件下载地址：<a href="https://github.com/oldj/SwitchHosts/releases" target="_blank" rel="noreferrer">Releases · oldj/SwitchHosts (github.com)</a></p><p><img src="https://cdn.jsdelivr.net/gh/lijing-2008/PicGo/img/8aQ5A1z8.png" alt="1671017367707.png"></p><h2 id="二、steam" tabindex="-1">二、Steam++ <a class="header-anchor" href="#二、steam" aria-label="Permalink to &quot;二、Steam++&quot;">​</a></h2><p>官方网址：<a href="https://steampp.net/" target="_blank" rel="noreferrer">Watt Toolkit - 瓦特工具箱(Steam++官网) (steampp.net)</a></p><p>常见问题集锦：<a href="https://steampp.net/faq" target="_blank" rel="noreferrer">Watt Toolkit - 常见问题疑难解答 (steampp.net)</a></p><h2 id="三、fastgithub" tabindex="-1">三、fastgithub <a class="header-anchor" href="#三、fastgithub" aria-label="Permalink to &quot;三、fastgithub&quot;">​</a></h2><h3 id="_1-解决-xxx-cannot-be-opened-because-the-developer-cannot-be-verified" tabindex="-1">1. 解决 &quot;XXX&quot; cannot be opened because the developer cannot be verified <a class="header-anchor" href="#_1-解决-xxx-cannot-be-opened-because-the-developer-cannot-be-verified" aria-label="Permalink to &quot;1. 解决 &quot;XXX&quot; cannot be opened because the developer cannot be verified&quot;">​</a></h3><p>打开终端进入FastGithub执行文件所在路径执行命令： <code>sudo xattr -d com.apple.quarantine *.*</code></p><h3 id="_2-安装证书" tabindex="-1">2. 安装证书 <a class="header-anchor" href="#_2-安装证书" aria-label="Permalink to &quot;2. 安装证书&quot;">​</a></h3><p>打开FastGithub后，目录内会生成cacert目录，双击打开fastgithub.cer，系统弹出Keychain Access窗口，列表中双击FastGitHub，弹出证书详情窗口，展开Trust并选择Always Trust。</p><p>双击无效的话直接将FastGithub拖入命令行，执行</p><img src="https://gitlab.com/lijing-2008/blogpic/-/raw/main/pictures/2022/12/18_9_48_21_image-20221218094550801.png" alt="image-20221218094550801" style="zoom:50%;"><img src="https://gitlab.com/lijing-2008/blogpic/-/raw/main/pictures/2022/12/18_9_44_9_image-20221218094408950.png" alt="image-20221218094408950" style="zoom:50%;"><h3 id="_3-配置代理" tabindex="-1">3.配置代理 <a class="header-anchor" href="#_3-配置代理" aria-label="Permalink to &quot;3.配置代理&quot;">​</a></h3><h4 id="_3-1-自动代理" tabindex="-1">3.1 自动代理 <a class="header-anchor" href="#_3-1-自动代理" aria-label="Permalink to &quot;3.1 自动代理&quot;">​</a></h4><p>打开mac设置，网络，点击高级，选择代理，勾选网自动代理配置，填写FastGithub窗口提示的地址</p><img src="https://gitlab.com/lijing-2008/blogpic/-/raw/main/pictures/2022/12/18_9_48_9_image-20221218094704236.png" alt="image-20221218094704236" style="zoom:50%;"><h4 id="_3-2-手动代理" tabindex="-1">3.2 手动代理 <a class="header-anchor" href="#_3-2-手动代理" aria-label="Permalink to &quot;3.2 手动代理&quot;">​</a></h4><p>打开mac设置，网络，点击高级，选择代理，勾选网页代理(HTTP)及安全网页代理(HTTPS),填写FastGithub窗口提示的地址</p><blockquote><p>上网工具也可以在网盘下载：</p><p>链接: <a href="https://pan.baidu.com/s/1aH7jVz9GC3WGBgj9L7ifgg" target="_blank" rel="noreferrer">https://pan.baidu.com/s/1aH7jVz9GC3WGBgj9L7ifgg</a> 提取码: fawp</p></blockquote>',24),r=[o];function s(n,h,c,p,d,b){return t(),a("div",null,r)}const g=e(l,[["render",s]]);export{_ as __pageData,g as default};
